import styled from 'styled-components';

const SectionSubHeading = styled.h3`
  color: var(--sub-color);
  font-family: var(--main-font);
  font-size: 1.2rem;
  font-weight: 700;
  text-transform: capitalize;
`;

export default SectionSubHeading;
